import { Chart, Tooltip, Axis, Line, Point } from 'viser-react';
import * as React from 'react';

const data = [
  { year: '1991', value: 3 },
  { year: '1992', value: 4 },
  { year: '1993', value: 3.5 },
  { year: '1994', value: 5 },
  { year: '1995', value: 4.9 },
  { year: '1996', value: 6 },
  { year: '1997', value: 7 },
  { year: '1998', value: 9 },
  { year: '1999', value: 13 },
];

const scale = [{
  dataKey: 'value',
  min: 0,
},{
  dataKey: 'year',
  min: 0,
  max: 1,
}];

class Reactjs extends React.Component {
  render() {
    return (
      <div style={{ width: '100%', height: 300 }}>
        <ResponsiveContainer>
          <PieChart>
            <Pie dataKey="value"
            data={data}
            fill="#8884d8"
            Label dataKey="name"
            />
          </PieChart>
        </ResponsiveContainer>
      </div>
    );
  }
}

export default  Reactjs
